find cumulative number of shops of past 12 month in mongodb<p>I want to find the cumulative number of shops of past 12 month.</p>
<pre><code>Sample Collection
{
  _id: '5f3d4e5e01e06f0007335233',
  name: 'Walmart',
  createdAt: '2020-08-22T17:42:09.908+00:00'
}
</code></pre>
<p>I am able to get result of new shops of past 12 month</p>
<pre><code>Shop.aggregate([{
  $match: {
     createdAt: {
      $gte: {
        $date: {{moment.utc().subtract(12, &quot;months&quot;).startOf('day').toISOString()}}
      },
      $lt: {
        $date: {{moment.utc().startOf('day').toISOString()}}
      }
    },
    }
}, {
  $project: {
    dateParts: {
      $dateToParts: { date: '$createdAt' }
    },
    total: true,
  }
}, {
    $group: {
      _id:  {
        month: '$dateParts.month',
        year: '$dateParts.year',
      },
      numShops: { $sum: 1 },
    }
}])
</code></pre>
<p>And this query returns result something like this</p>
<pre><code>[{
  _id: {
    month:3,
    year:2021
  },
  numShops:62,
}, {
.
.
.
}]
</code></pre>
<p>The above query only returns the new shops of past 12 months, but I want total shops until specific month.</p>
<p>Query must return result something like</p>
<pre><code>[{
  date: 'Aug-2020',
  numShops: 100,   // Total number of shops until aug-2020
}, {
  date: 'Sep-2020'
  numShops: 230, // Total number of shops until sep-2020
}, ....
]
</code></pre>

