<p>There must be a better way of doing this. I read about <code>JS procedures</code>, but seems like everyone advice against it and not sure if you can run something like this within a <code>JS procedures</code>. I have also thought about running the loop parallel, but that sounds unstable and probably will run into network or other type of errors.</p>
<p>Product example:</p>
<pre><code>{
 &quot;_id&quot;: &quot;..&quot;,
 &quot;minPrice: &quot;40&quot;,
 &quot;numberOfOffers&quot;: &quot;2&quot;
}
</code></pre>
<p>Product offer example:</p>
