node/express api url params<p>i'm making an api using nodejs/express and i'm in doubt of what is the best way to query the params and get the result from the db. i'm doing like this but I dont think it's good. is there a best and more optimised way of doing it</p>
<pre><code>router.get(&quot;/all&quot;, async (req, res) =&gt; {
  try {
    let data = await Items.find();

    if (req.query.lang &amp;&amp; req.query.category) {
      data = await Items.find({
        lang: req.query.lang,
        category: req.query.category,
      });
    } else if (req.query.lang) {
      data = await Items.find({ lang: req.query.lang });
    } else if (req.query.category) {
      data = await Items.find({ category: req.query.category });
    } else {
      data = await Items.find();
    }

    res.status(200).send(data);
  } catch (err) {
    res.status(500).json({ message: err });
  }
});
</code></pre>

