Do we still need Morphia for Java?<p>For my project I use <a href="https://github.com/MorphiaOrg/morphia" rel="nofollow noreferrer">Morphia</a>, for easily mapping POJO objects to the Mongodb database. But in 2018 the <a href="http://mongodb.github.io/mongo-java-driver/" rel="nofollow noreferrer">mongo java driver</a> started supporting pojo mapping it self and the Morphia project was abandoned by the Mongodb team. The Morphia community edition has now deprecated the <a href="https://morphia.dev/morphia/1.6/javadoc/dev/morphia/dao/DAO.html" rel="nofollow noreferrer">DAO</a> and I wonder, why not write my own DAO class based on the Mongodb driver directly? So my question:</p>
<p><strong>Do we still need Morphia when using Mongodb and Java? And what benefits does Morphia bring over using the Mongodb Java driver directly?</strong></p>
<pre><code>Example code for using the Java driver:

// Getting an object by id:
collection.find(eq(&quot;_id&quot;, id), Pojo.class).first();

// Insert into collection
collection.insertOne(pojo);

// Update
collection.replaceOne(eq(&quot;_id&quot;, id), pojo);

// Delete
collection.deleteMany(filter).getDeletedCount();
</code></pre>

