Can I get counts for different field values in a MongoDB aggregation pipeline?<p>I have a collection with documents that represent orders for laptops. A TypeScript interface for an order is:</p>
<pre class="lang-js prettyprint-override"><code>interface DeviceOrder {
    _id: uuid,
    manufacturer: &quot;Lenovo&quot; | &quot;Apple&quot; | &quot;HP&quot;,
    devices: number,
    sentTo: &quot;Finland&quot; | &quot;Sweden&quot; | &quot;Denmark&quot;
}
</code></pre>
<p>So a couple of documents could look like, for example:</p>
<pre class="lang-json prettyprint-override"><code>{
    &quot;_id&quot;: &quot;0bdc15a1-168c-4086-aece-473228dcc741&quot;,
    &quot;manufacturer&quot;: &quot;Apple&quot;,
    &quot;devices&quot;: 30,
    &quot;sentTo&quot;: &quot;Denmark&quot;
}
{
    &quot;_id&quot;: &quot;ff8abefb-a39a-4830-9165-356a501ebea9&quot;,
    &quot;manufacturer&quot;: &quot;Lenovo&quot;,
    &quot;devices&quot;: 12,
    &quot;sentTo&quot;: &quot;Finland&quot;
}
</code></pre>
<p>I'm trying to build an aggregation pipeline that would give me <em>for each manufacturer</em> the total number of orders, the total number of devices ordered, and then a count of devices sent to the different countries:</p>
<pre class="lang-js prettyprint-override"><code>{
    manufacturer: &quot;Apple&quot;,
    orders: 45,
    devices: 332,
    countries: {
        Finland: 300,
        Sweden: 16,
        Denmark: 16
    }
}
</code></pre>
<p>(Of course the <code>devices</code> field isn't essential here, as it's simply a sum of the devices sent to the three different countries)</p>
<p>Is writing a pipeline to get this data the right way to go? And if so, how should I structure it?</p>

